import React from 'react';
import Navbar from './Navbar';

function Header()
{
    return(

        <header className="site-header">
            <div className="container">
                <a href="/" id="branding">
                    <img src="../images/logo.svg" alt="Site Title"></img>
                    <h1 class="site-description">Great Live Music.Period</h1>
                </a>
                <Navbar />
            </div>
        </header>
    )
}

export default Header;
